  components:
  - type: RichText
    properties: {role: null, align: left, tooltip: '', enable_slots: true, border: '',
      foreground: '', visible: true, font_size: null, content: "**I.\tIdentification**\n\
        \n1.\tTheme /Subject: Jebel Slata reef \n2.\tSite: Jebel Slata\n3.\t Location:\
        \ 35.86064, 8.46669\n\n**II.\tTips and practical information** :\n\n- Land\
        \ status: State-owned\n- Access: easy via tarmac road in good condition\n\
        - Departure point: the town of Le Kef (fig.2). - Distance: approx. 46 km (via\
        \ the town of Tajerouine) or 62 via J. Harraba (fig.1).\n- Lack of signage\n\
        - Undeveloped site access paths\n- Access to the various galleries is somewhat\
        \ difficult. \n- Wear shoes, helmet, gloves...\n\n**III.\tSite description**\n\
        \n**1 Interest in visiting the site**\n\n **Landscape interest**\n\n**Landscape\
        \ interest**\n  \nJebel Slata is another Aptian carbonate massif peaking at\
        \ 800 m in the middle of vast plains whose altitude does not exceed 300 to\
        \ 400 m. This massif is easily climbed to its highest point. From here, you\
        \ can enjoy a panoramic view that includes the towns of Tajerouine and Jeridssa\
        \ to the east, the Oued Sarrat dam to the south and several mountain ranges\
        \ to the west, stretching all the way to the Algerian border (fig. 3). The\
        \ Ouenza mountain in Algeria, which contains the largest iron ore mine still\
        \ in operation in North Africa, can be seen here.\n\n**Geological interest**\n\
        \ :\nThe Jebel Slata massif is a fold formed by an imposing bed of reef limestone\
        \ of Aptian age (-114 to -108 Ma). It is an arc-shaped structure with a convexity\
        \ facing NE (fig.3). It rests on Triassic terrain, which appears at its SW\
        \ end. The whole is enveloped by more recent Upper Cretaceous deposits. \n\
        \n**Paleontological significance**\n\nTo see the entire geological series\
        \ from the base of the J.Slata, follow route AB (fig.3). \n\nThe section starts\
        \ in the Triassic Terrains with their characteristic variegated facies, followed\
        \ by a series of bioclastic limestones, grey marls and sandstones. The series\
        \ continues with a mass of reef limestones, in which a polypier can be seen\
        \ in a life-like position (photo). Polypiers are called corals and are organisms\
        \ that participate in the construction of reef limestones. between -114 and\
        \ -108 Ma.\nOther organisms, such as oysters and sea urchins, thrive in these\
        \ same rocks, and can be seen on site due to their large size (photos).\n\
        \ \n**Mining interest**\n\nThe reef limestones also contain the largest deposits\
        \ of lead (galena), zinc (blende) and iron, which have been mined in the past.\
        \ \n\nAt Jebel Slata, you'll find the remains of several mines exploited in\
        \ the past: \n\n- The iron mine at the western end can be recognized by the\
        \ ochre color of the iron and the fact that it was not mined in the past.\
        \ The mineral extracted is represented by iron oxides (hematite).\n- Lead/zinc\
        \ mine with old installations and waste rock stockpiles from which lead/zinc\
        \ mineralization has been extracted.\n- Mining of barite and celestine.\n\n\
        **2.\tSummary of important information to remember** : \n\nThe Jebel Slata\
        \ site is a reef built by builder organisms (corals) during the Late Aptian\
        \ (-114 to -108 Ma). The depositional environment was a submarine high zone\
        \ (no more than 200 m deep) with a diapiric Triassic core. \n\nThe reef emerged\
        \ and folded during the Tertiary deformation phases that gave rise to the\
        \ mountain ranges. As they folded, the reef limestones were intensely fractured.\
        \ The faults and porosity of these facies appear to have played an important\
        \ role in the potential transport of metal-rich fluids from great depths to\
        \ the surface. Once these mineralized fluids reach the surface, their temperatures\
        \ and pressures drop. The mineralization they carry then precipitates in the\
        \ faults and voids created by these same fluids. This process is at the origin\
        \ of lead-zinc and iron mineralization. \n\n\n**IV.\tFind out more** : \n\n\
        **Bibliographical references**\n\n- Sainfeld P (1956). The lead-zinc-bearing\
        \ deposits of Tunisia- Economic Geology v.51, pp 150-177\n\n- Dubourdieu,\
        \ G. (1956). \xc9tude g\xe9ologique de la r\xe9gion de l'Ouenza (confins Alg\xe9\
        roTunisiens). Publications du service de la carte g\xe9ologique de l'Alg\xe9\
        rie (nouvelle s\xe9ries), Bulletin n\xb0 10, 659 pp.\n\n**Resource persons**\n\
        \nMongi Chikhaoui- e-mail:chikhaoui_mongi@gmail.com\n", font: '', spacing_above: small,
      spacing_below: small, data: null, background: '', format: markdown}
